import React from 'react';
import styled from "styled-components";

const COLORS = {
    primaryDark: "#115b4c",
    primaryLight: "B6EDC8",
}



const NavBackground = styled.div`
position: fixed;
top: 6.5rem;
left: 6.5rem;
background-image: radial-gradient(
    ${COLORS.primaryDark},
    ${COLORS.primaryLight}
);
height: 6rem;
width: 6rem;
border-radius: 50%;
`;


const HamburgerMenu = () => {
    return (
        <>
            <NavBackground> &nbsp; </NavBackground>
        </>
    );
};

export default HamburgerMenu;
